import React from 'react'
import { VscDebugRestart } from 'react-icons/vsc'
import { AiFillQuestionCircle } from 'react-icons/ai'

const CompletedPage = (props) => {
  console.log(props)

  const createWrongQuestions = () => {
    let answerString = ''
    for (let i = 0; i < props.wrongQuestions.length; i++) {
      if (i == props.wrongQuestions.length - 1) {
        answerString += props.wrongQuestions[i]
      } else {
        answerString += props.wrongQuestions[i] + ', '
      }
    }

    return answerString
  }

  return (
    <div className='completed-container'>
        <h1>You've Completed the Test!</h1>
        <h2>You Guessed {props.points} Questions <br /> of the 30 Correctly!</h2>

        <a className='restart-button' onClick={() => {
          props.setPoints(0)
          console.log(props.points)
        }} href='/'><VscDebugRestart /></a>

        <div className='tooltip'><AiFillQuestionCircle />
          <span className='tooltiptext'>^</span>
          <span className='tooltiptext' id='test'>*Wrong Questions*</span>
          <span className='tooltiptext' id='wrong-questions'>{createWrongQuestions()} </span>
        </div>
    </div>
  )
}

export default CompletedPage
